function Form() {
    return( 
        <div className="form_6">
            <div>
                <div style={{fontSize: 20}}>05 - Get Involved</div>
                <div style={{fontSize: 40, fontWeight: 600, width: 1000}}>Join our Expedition</div>
                <div style={{width: 700}}> <b>The Expedition Team</b> will be <b>selected</b> through several stages. Only about <b>8 people</b> will be selected to join this expedition. Make sure you are <b>one of them!</b></div>
        
            </div>
        </div>
    )
}

export default Form;
